import React, { Component } from 'react';
// import ReactDOM from "react-dom";
import './App.css';

class Header extends Component {
  render () {
    return(
      <div class="header">
        This is the header.
      </div>
    )
  }
}

class GridItem extends Component {
  render () {
    return(
      <div>This is a grid item</div>
    )
  }
}

class PlaceGrid extends Component {
  renderGridItem () {
    return <GridItem />
  }

  render () {
    return(
      <div class="grid">
        {this.renderGridItem()}
        {this.renderGridItem()}
      </div>
    )
  }
}

class App extends Component {
  renderHeader () {
    return <Header /> 
  }

  renderPlaceGrid () {
    return <PlaceGrid /> 
  }

  render() {
    return(
      <div>
        <Header /> 
        <PlaceGrid /> 
      </div>
    )
  }
}

export default App;
